mapper.select:
select 

from TAW_ROLE_DOMAIN
where DOMAIN_ID = #{domainId,jdbcType=VARCHAR}
  and ROLE_ID = #{roleId,jdbcType=VARCHAR}

mapper.delete:
delete from TAW_ROLE_DOMAIN
where DOMAIN_ID = #{domainId,jdbcType=VARCHAR}
  and ROLE_ID = #{roleId,jdbcType=VARCHAR}

mapper.insert:
insert into TAW_ROLE_DOMAIN (DOMAIN_ID, ROLE_ID, DOMTYPEID
  )
values (#{domainId,jdbcType=VARCHAR}, #{roleId,jdbcType=VARCHAR}, #{domtypeid,jdbcType=VARCHAR}
  )

mapper.update:
update TAW_ROLE_DOMAIN


    DOMTYPEID = #{domtypeid,jdbcType=VARCHAR},


where DOMAIN_ID = #{domainId,jdbcType=VARCHAR}
  and ROLE_ID = #{roleId,jdbcType=VARCHAR}

update TAW_ROLE_DOMAIN
set DOMTYPEID = #{domtypeid,jdbcType=VARCHAR}
where DOMAIN_ID = #{domainId,jdbcType=VARCHAR}
  and ROLE_ID = #{roleId,jdbcType=VARCHAR}

